import React from "react";
import styled from "styled-components";

import { galleryPanfu } from "../helpers/data";

export default function Gallery() {
  return (
    <GalleryContainer>
      {galleryPanfu.map((imag, i) => {
          return (<div key={i}>
              <img src={imag.image} />
          </div>)
      })}
    </GalleryContainer>
  );
}

const GalleryContainer = styled.section`
display: flex;
max-width: ;
`
